import React from 'react';

export default class Message extends React.Component<any> {

    constructor(props: any) {
        super(props);
        this.state = {
            start:false
        }
    }

    startMessage = ()=>{
        this.setState({
            start: true? false:true,
        })
    }

    render(){
        return(
            <>
            { this.state.start && <div className="messageContainer"></div> }
            <div className="messageControler"><button onClick="startMessage">show</button><span className="messageNew"></span></div>
            </>
        )
    }
}
